import React from 'react';
import styles from '../../../../App.css';

const day = (props) => {
        return (
            <div className={styles.dayCard} onClick={props.click}>
                <p>{props.city}</p>
                <p>{props.day}</p>
                <p>{props.date}</p>
                <p>Maksimalna dnevna temperatura: {props.maxDayTemp}</p>
                <p>Minimalna dnevna temperatura: {props.minDayTemp}</p>
                <p>Maksimalna nocna temperatura: {props.maxNightTemp}</p>
                <p>Maksimalna nocna temperatura: {props.minNightTemp}</p>
                <p>Brzina vjetra: {props.windSpeed}</p>
                <p>Vlaznost vazduha: {props.humidity}</p>
            </div>

        );
}

export default day;
